using MareSynchronos.API.Data;
using MareSynchronos.API.Data.Comparer;
using MareSynchronos.API.Dto.User;
using MareSynchronos.MareConfiguration;
using MareSynchronos.Services.Mediator;
using MareSynchronos.WebAPI;
using Microsoft.Extensions.Logging;
using Newtonsoft.Json;
using Newtonsoft.Json.Serialization;
using System.Collections.Concurrent;

namespace MareSynchronos.Services;

public class MareProfileManager : MediatorSubscriberBase
{
    private const string _playerSyncProfileDefault = "";
    //private const string _mareLogo = "";
    //private const string _mareLogoLoading = "";
    //private const string _mareLogoNsfw = "";
    private const string _mareSupporter = "";
    private const string _mareLogo = _playerSyncProfileDefault;
    private const string _mareLogoLoading = _playerSyncProfileDefault;
    private const string _mareLogoNsfw = _playerSyncProfileDefault;
    private const string _noDescription = "-- User has no description set --";
    private const string _nsfw = "Profile is marked NSFW. Enable NSFW profiles in the settings to view.";
    private readonly ApiController _apiController;
    private readonly MareConfigService _mareConfigService;
    private readonly ConcurrentDictionary<UserData, MareProfileData> _mareProfiles = new(UserDataComparer.Instance);

    private readonly MareProfileData _defaultProfileData = new(IsFlagged: false, IsNSFW: false, _mareLogo, string.Empty, _noDescription);
    private readonly MareProfileData _loadingProfileData = new(IsFlagged: false, IsNSFW: false, _mareLogoLoading, string.Empty, "Loading Data from server...");
    private readonly MareProfileData _nsfwProfileData = new(IsFlagged: false, IsNSFW: true, _mareLogoNsfw, string.Empty, _nsfw);

    public MareProfileManager(ILogger<MareProfileManager> logger, MareConfigService mareConfigService,
        MareMediator mediator, ApiController apiController) : base(logger, mediator)
    {
        _mareConfigService = mareConfigService;
        _apiController = apiController;

        Mediator.Subscribe<ClearProfileDataMessage>(this, (msg) =>
        {
            if (msg.UserData != null)
                _mareProfiles.Remove(msg.UserData, out _);
            else
                _mareProfiles.Clear();
        });
        Mediator.Subscribe<DisconnectedMessage>(this, (_) => _mareProfiles.Clear());
    }

    public MareProfileData GetMareProfile(UserData data)
    {
        if (!_mareProfiles.TryGetValue(data, out var profile))
        {
            _ = Task.Run(() => GetMareProfileFromService(data));
            return (_loadingProfileData);
        }

        return (profile);
    }

    public void RemoveMareProfile(UserData data)
    {
        _mareProfiles.Remove(data, out _);
    }

    public bool IsProfileMarkedNsfwOrAllowed(MareProfileData profile, UserData user)
    {
        return !(profile.IsNSFW && !_mareConfigService.Current.ProfilesAllowNsfw && !string.Equals(_apiController.UID, user.UID, StringComparison.Ordinal)) || !profile.IsNSFW;
    }

    private async Task GetMareProfileFromService(UserData data)
    {
        try
        {
            _mareProfiles[data] = _loadingProfileData;
            var profile = await _apiController.UserGetProfile(new API.Dto.User.UserDto(data)).ConfigureAwait(false);
            MareProfileData profileData = new(profile.Disabled, profile.IsNSFW ?? false,
                string.IsNullOrEmpty(profile.ProfilePictureBase64) ? _playerSyncProfileDefault : profile.ProfilePictureBase64,
                !string.IsNullOrEmpty(data.Alias) && !string.Equals(data.Alias, data.UID, StringComparison.Ordinal) ? _mareSupporter : string.Empty,
                string.IsNullOrEmpty(profile.Description) ? _noDescription : profile.Description);
            if (profileData.IsNSFW && !_mareConfigService.Current.ProfilesAllowNsfw && !string.Equals(_apiController.UID, data.UID, StringComparison.Ordinal))
            {
                _mareProfiles[data] = _nsfwProfileData;
            }
            else
            {
                _mareProfiles[data] = profileData;
            }
        }
        catch (Exception ex)
        {
            // if fails save DefaultProfileData to dict
            Logger.LogWarning(ex, "Failed to get Profile from service for user {user}", data);
            _mareProfiles[data] = _defaultProfileData;
        }
    }

    public static class ProfileHandler
    {
        private static readonly JsonSerializerSettings Settings = new()
        {
            MissingMemberHandling = MissingMemberHandling.Ignore,
            NullValueHandling = NullValueHandling.Ignore,
            DefaultValueHandling = DefaultValueHandling.Ignore,
            ContractResolver = new DefaultContractResolver
            {
                NamingStrategy = new CamelCaseNamingStrategy
                {
                    ProcessDictionaryKeys = true,
                    OverrideSpecifiedNames = false,
                }
            }
        };

        public static ProfileV1 Read(string? raw)
        {
            raw = (raw ?? string.Empty).Trim();

            if (raw.StartsWith("{", StringComparison.Ordinal))
            {
                try
                {
                    return JsonConvert.DeserializeObject<ProfileV1>(raw, Settings) ?? new ProfileV1();
                }
                catch { }
            }
            return new ProfileV1{Version = 1, AboutMe = raw, Theme = new ProfileTheme() };
        }

        public static string WriteJson(ProfileV1 doc, Formatting formatting = Formatting.None)
        {
            doc ??= new ProfileV1();
            return JsonConvert.SerializeObject(doc, formatting, Settings);
        }
    }
}